ll as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.";s:15:"gettext_context";s:0:"";}i:696;O:8:"stdClass":6:{s:2:"id";s:4:"1517";s:6:"status";N;s:3:"ctx";s:32:"a24d06ba20bbc9ad1b7f8b3d334e7d15";s:10:"translated";N;s:8:"original";s:127:"This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.";s:15:"gettext_context";s:0:"";}i:697;O:8:"stdClass":6:{s:2:"id";s:4:"1518";s:6:"status";N;s:3:"ctx";s:32:"40de51e1c0d646fdf0d7d9f4efaa3ea7";s:10:"translated";N;s:8:"original";s:99:"You must click the Save Changes button at the bottom of the screen for new settings to take effect.";s:15:"gettext_context";s:0:"";}i:698;O:8:"stdClass":6:{s:2:"id";s:4:"1519";s:6:"status";N;s:3:"ctx";s:32:"341dbad1916c2decd6aead18f094b18b";s:10:"translated";N;s:8:"original";s:209:"Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.";s:15:"gettext_context";s:0:"";}i:699;O:8:"stdClass":6:{s:2:"id";s:4:"1520";s:6:"status";N;s:3:"ctx";s:32:"8a085eced0d0591c402c82cff68cbc18";s:10:"translated";N;s:8:"original";s:210:"If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.";s:15:"gettext_context";s:0:"";}i:700;O:8:"stdClass":6:{s:2:"id";s:4:"1521";s:6:"status";N;s:3:"ctx";s:32:"898670c2e52a88ad0454c93711770605";s:10:"translated";N;s:8:"original";s:217:"When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes <code>%category%</code> or <code>%tag%</code>.";s:15:"gettext_context";s:0:"";}i:701;O:8:"stdClass":6:{s:2:"id";s:4:"1522";s:6:"status";N;s:3:"ctx";s:32:"6df19e5a9afce680bb53549314ac67cd";s:10:"translated";N;s:8:"original";s:17:"Custom Structures";s:15:"gettext_context";s:0:"";}i:702;O:8:"stdClass":6:{s:2:"id";s:4:"1523";s:6:"status";N;s:3:"ctx";s:32:"c686ed3a11e088be1973308ebe9e40cb";s:10:"translated";N;s:8:"original";s:308:"The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.";s:15:"gettext_context";s:0:"";}i:703;O:8:"stdClass":6:{s:2:"id";s:4:"1524";s:6:"status";N;s:3:"ctx";s:32:"7c7865bf718adb0ed9a3abd86a6efd47";s:10:"translated";N;s:8:"original";s:105:"<a href="https://codex.wordpress.org/Settings_Permalinks_Screen">Documentation on Permalinks Settings</a>";s:15:"gettext_context";s:0:"";}i:704;O:8:"stdClass":6:{s:2:"id";s:4:"1525";s:6:"status";N;s:3:"ctx";s:32:"72ee400c9062c148c288dab26d78ae6d";s:10:"translated";N;s:8:"original";s:92:"<a href="https://codex.wordpress.org/Using_Permalinks">Documentation on Using Permalinks</a>";s:15:"gettext_context";s:0:"";}i:705;O:8:"stdClass":6:{s:2:"id";s:4:"1526";s:6:"status";N;s:3:"ctx";s:32:"ef56828a2feacb6d1071e6f9c4e5adf5";s:10:"translated";N;s:8:"original";s:339:"WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="https://codex.wordpress.org/Using_Permalinks">number of tags are available</a>, and here are some examples to get you started.";s:15:"gettext_context";s:0:"";}i:706;O:8:"stdClass":6:{s:2:"id";s:4:"1527";s:6:"status";N;s:3:"ctx";s:32:"893deb279edb537cdde635951eeeea6e";s:10:"translated";N;s:8:"original";s:8:"archives";s:15:"gettext_context";s:21:"sample permalink base";}i:70